        <div id='day-card-container'>
        {dayItems?.map((day, index) => (
            <div key={index} id='day-card' className={props.errorState ? '' : 'hidden-card-state'}>
                <h2 style={{ opacity: 0 }}>ASDF<br/>ASDF</h2>
